import React from 'react';
import { Button,Nav,NavbarBrand,Navbar } from 'react-bootstrap';
class Nave extends React.Component{
    render(){
     return (
 <div className="App">
<Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">
      <img
        alt=""
        src="/logo.svg"
        width="30"
        height="30"
        className="d-inline-block align-top"
      />
      {' React Bootstrap'}
    </Navbar.Brand>
  </Navbar>
</div>
        )
    }
}
export default Nave;
